import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card'
import Cdata from './Cdata'

console.log(Cdata[0]);
ReactDOM.render(
    <>
    <h1> Welcome to a demonstation of a React App</h1>
    <div className="card_container">
        <Card 
        isc={Cdata[0].isc}
        titel={Cdata[0].titel}
        txt={Cdata[0].txt}
        />

        <Card 
        isc={Cdata[1].isc}
        titel={Cdata[1].titel}
        txt={Cdata[1].txt}
        />

        <Card 
        isc={Cdata[2].isc}
        titel={Cdata[2].titel}
        txt={Cdata[2].txt}
        />

        <Card 
        isc={Cdata[3].isc}
        titel={Cdata[3].titel}
        txt={Cdata[3].txt}
        />

        <Card 
        isc={Cdata[4].isc}
        titel={Cdata[4].titel}
        txt={Cdata[4].txt}
        />

        <Card 
        isc={Cdata[5].isc}
        titel={Cdata[5].titel}
        txt={Cdata[5].txt}
        />



    </div>
    </>,
    document.getElementById('root')
);
